const cdsj1StudentsSchoolusers = []

const generateCDSJ1StudentsSchoolusers = (uuid, ctx) => {
  usersData.forEach((user, index) => {
    cdsj1StudentsSchoolusers.push({
      ...user,
      email: `${user.username}@student.cdsj.edu.mo`,
      id: uuid(),
      is_student: true,
      is_admin: false,
      groups: ['student'],
      created_at: new Date(),
      user_id: ctx.users.obj[user.username].id,
      school_id: ctx.schools.obj['school-cdsj1'].id
    })
  })
  return cdsj1StudentsSchoolusers
}

const cdsj1StudentsUsers = []

const generateCDSJ1StudentsUsers = (uuid) => {
  usersData.forEach((user, index) => {
    cdsj1StudentsUsers.push(
      {
        ...user,
        email: `${user.username}@student.cdsj.edu.mo`,
        id: uuid(),
        is_admin: false,
        groups: ['student'],
        created_at: new Date()
      }
    )
  })

  return cdsj1StudentsUsers
}

module.exports = {
  usersData,
  cdsj1StudentsSchoolusers,
  generateCDSJ1StudentsSchoolusers,
  cdsj1StudentsUsers,
  generateCDSJ1StudentsUsers
}
